import React, { Component } from "react";
import "./group.scss";
import { backend_url } from "../../const";
import axios from "axios";
export default class Groups extends Component {
  componentDidMount() {
    axios.get(url_header + "/backend/group/").then(res => {
      this.setState({
        old_project_data: res.data,
      });
    });
  }
  render() {
    return (
      <div className="groups">
        <div className="groups-unit">
          <p className="group-name">SDSLabs</p>
        </div>
      </div>
    );
  }
}
